@drbogash @davidgoldiner @JamesSurowiecki @zmkc And even then, recall that in the Pfizer #CovidVaccine trial 18K got the vaccine and 18K (the *control*) did not.
Clearly both groups had an *equal* chance of getting the virus yet, despite that, 99.1% of the control tested NEGATIVE afterwards.
There's so much confusion around.
